var currentChoice = 0;

function ShouldRecurse(depth)
{
    if (recurseStatically) { return choices[currentChoice++] == 1; }

    var w = (Math.log((maxDepth + 1) / (depth * 2)) / Math.log(maxDepth + 2)) - Math.log(0.5); // maxDepth + 2 to make sure that p(1) is not 1    

    var p = Math.random();
    if (p < w) {
        choices.push(1);
    } else {
        choices.push(0);
    }

    return (p < w);
}

function EvolveType(type, depth)
{
    if (depth > maxBranch) maxBranch = depth;
    if (depth > maxDepth) return;

//    WScript.Echo(depth + ", " + (w) + ", " + p);
    if (ShouldRecurse(depth)) {
        for (var i = 0; i < (maxDepth - depth) / 6; i++) {
            var t = {};
            t.prototype = type;
            t[GetRandomString()] = i * depth;
            numTypes++;

            EvolveType(t, depth + 1);
        }
    } 
}

function RootType() {}

CollectGarbage();
EvolveType(new RootType(), 1);

WScript.Echo("Number of types: " + numTypes);
WScript.Echo("Deepest branch: " + maxBranch);

if (dumpDecisionTree)
{
  var sb = [];
  for (var i = 0; i < choices.length; i++)
  {
     sb.push(choices[i] + ", "); 
     if ((i + 1) % 78 == 0 || (i == choices.length - 1)) { WScript.Echo(sb.join('')); sb = []; };
  }
}